import React from "react";

function AboutUs() {
  return (
    <div>
      <div className="slogan-container">
        <h1>"Un vistazo a lo que nos importa"</h1>
      </div>
      <div className="aboutus-container">
        <p>
          La revista ZAGAZINE es una publicación de ZAGA RELACIONES PÚBLICAS
          S.A. DE C.V. Es la guía de estilo de vida para personas únicas,
          independientes e inteligentes que buscan estar al día con temas
          relevantes. Su ADN es innovador, fresco e inclusivo. Busca que los
          lectores se inspiren, encuentren su estilo y lo celebren a partir de
          una óptica nueva, divertida y diferente en una conversación
          desenfadada y comprometida en crear un mundo mejor.
        </p>
      </div>
    </div>
  );
}

export default AboutUs;
